import React from 'react'

export default function Informations({informationsData}) {
    return (
        <div>
            <h1>Informations</h1>
            <div>
                {Object.entries(informationsData).map((data) =>
                    <a href=''></a>
                )}
            </div>
        </div>
    )
}
